import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Header from './components/Header';
import UserLogin from './components/UserLogin';
import ListPatient from './components/ListPatient';
import CreateUser from './components/CreateUser';
import ViewUser from './components/ViewUser';
import Footer from './components/Footer';
import ViewPatient from './components/ViewPatient';
import CreatePatient from './components/CreatePatient';
import UpdatePatient from './components/UpdatePatient';
import ListSymptom from './components/ListSymptom';
import ViewSymptom from './components/ViewSymptom';
import CreateSymptom from './components/CreateSymptom';

function App() {
  return (
    <div>
      <Router forceRefresh={true}>
        <Header/>   
        <div className="container">
          <Switch>
            <Route exact path="/" component={UserLogin}></Route>
            <Route exact path="/list-patients/:id" component={ListPatient}></Route>
            <Route exact path="/list-symptoms" component={ListSymptom}></Route>
            {/* <Route exact path="/users" component={ListUser}></Route> */}
            <Route exact path="/add-user/:id" component={CreateUser}></Route>
            <Route exact path="/add-patient/:id" component={CreatePatient}></Route>
            <Route exact path="/add-symptom/:id" component={CreateSymptom}></Route>
            <Route exact path="/update-patient/:id" component={UpdatePatient}></Route>
            <Route exact path="/view-user/:id" component={ViewUser}></Route>
            <Route exact path="/view-patient/:id/:idPatient" component={ViewPatient}></Route>
            <Route exact path="/view-symptom/:id" component={ViewSymptom}></Route>
            {/* <Route path = "/update-user/:id" component = {UpdateUserComponent}></Route> */}
          </Switch>
        </div>
        <Footer/>
      </Router>
    </div>
  );
}

export default App;
